from sympy import *
import numpy as np
import pickle

u, v, rho_sigma, H, h_bar, k, m, m_bar, q, q_bar = symbols('u v rho_sigma H h_bar k m m_bar q q_bar')
L, phi = symbols('L phi')
a, b, c, d, alpha, beta, gamma, delta = symbols('a b c d alpha beta gamma delta')
x = symbols('x')

A = Matrix([[rho_sigma * v, u, 0, 0, -1, -exp(I*q*L), 0, 0],
            [u, rho_sigma * v, 0, 0, 0, 0, -exp(-I*q_bar*L), -1],
            [0, 0, -u*exp(I*phi/2), -rho_sigma * v * exp(I*phi/2), exp(I*q*L), 1, 0, 0],
            [0, 0, -rho_sigma * v * exp(-I*phi/2), -u*exp(-I*phi/2), 0, 0, 1, exp(-I*q_bar*L)],
            [-rho_sigma * v * (2*H/h_bar**2 + I*k/m), -u * (2*H/h_bar**2 - I*k/m), 0, 0, I*q/m_bar, -I*q*exp(I*q*L)/m_bar, 0, 0],
            [-u * (2*H/h_bar**2 + I*k/m), -rho_sigma * v * (2*H/h_bar**2 - I*k/m), 0, 0, 0, 0, I*q_bar*exp(-I*q_bar*L)/m_bar, -I*q_bar/m_bar],
            [0, 0, -u * exp(I*phi/2) * (2*H/h_bar**2 - I*k/m), -rho_sigma * v * exp(I*phi/2) * (2*H/h_bar**2 + I*k/m), -I*q*exp(I*q*L)/m_bar, I*q/m_bar, 0, 0],
            [0, 0, -rho_sigma * v * exp(-I*phi/2) * (2*H/h_bar**2 - I*k/m), -u * exp(-I*phi/2) * (2*H/h_bar**2 + I*k/m), 0, 0, -I*q_bar/m_bar, I*q_bar*exp(I*q_bar*L)/m_bar]
           ])

determinant = A.det()

with open('determinant.pkl', 'wb') as output:
    pickle.dump(determinant, output, pickle.HIGHEST_PROTOCOL)

print(determinant)

